import React from "react";
import { useNavigate } from "react-router-dom";
import "../../styles/Auth.css";

const AuthChoice = () => {
  const navigate = useNavigate();

  return (
    <div className="main-container">
      <div className="auth-card">
        <h2 className="card-title">Welcome to the Job Portal</h2>
        <p className="card-description">Choose your role to get started:</p>
        <div className="button-group">
          <button className="role-button" onClick={() => navigate("/login-candidate")}>
            I'm a Candidate
          </button>
          <button className="role-button" onClick={() => navigate("/login-employer")}>
            I'm an Employer
          </button>
        </div>
      </div>
    </div>
  );
};

export default AuthChoice;
